package service;

import java.io.Serializable;
import java.util.ArrayList;
import java.util.List;

import javax.xml.bind.annotation.XmlAttribute;
import javax.xml.bind.annotation.XmlElement;
import javax.xml.bind.annotation.XmlRootElement;



@XmlRootElement(name = "applaunch")
public class TmLaunch implements Serializable {
	private static final long serialVersionUID = 1L;

	private List<String> publicUserRoles = new ArrayList<String>();
	private String contactInfo = "<html><head></head><body><h2>Insert contact info html into this variable</h2></body></html>";
	private String termsAndConditions = "<html><head></head><body><h2>Insert terms and conditions html into this variable</h2></body></html>";

	private List<String> securityQuestions = new ArrayList<String>();
	private String apiVersion = "1.0";
	private CustomData customData = null;
	
	private boolean success = true;
	private String errorMessage = null;
	private String dateReceived = null;
	private String referenceNumber = null;
	private String severity = null;
	private String token = null;

	
	@XmlElement(name = "publicUserRoles")
	public List<String> getPublicUserRoles() {
		return publicUserRoles;
	}

	public void setPublicUserRoles(List<String> publicUserRoles) {
		this.publicUserRoles = publicUserRoles;
	}

	@XmlElement(name = "contactInfo")
	public String getContactInfo() {
		return contactInfo;
	}

	public void setContactInfo(String contactInfo) {
		this.contactInfo = contactInfo;
	}

	@XmlElement(name = "termsAndConditions")
	public String getTermsAndConditions() {
		return termsAndConditions;
	}

	public void setTermsAndConditions(String termsAndConditions) {
		this.termsAndConditions = termsAndConditions;
	}

	@XmlElement(name = "securityQuestions")
	public List<String> getSecurityQuestions() {
		return securityQuestions;
	}

	public void setSecurityQuestions(List<String> securityQuestions) {
		this.securityQuestions = securityQuestions;
	}
	@XmlAttribute(name = "apiVersion")
	public String getApiVersion() {
		return apiVersion;
	}

	public void setApiVersion(String apiVersion) {
		this.apiVersion = apiVersion;
	}

	@XmlElement(name = "customData")
	public CustomData getCustomData() {
		return new CustomData();
	}

	public void setCustomData(CustomData customData) {
		this.customData = customData;
	}
	
	public boolean getSuccess() {
		return success;
	}

	public void setSuccess(boolean success) {
		this.success = success;
	}

	public String getErrorMessage() {
		return errorMessage;
	}

	public void setErrorMessage(String errorMessage) {
		this.errorMessage = errorMessage;
	}

	public String getDateReceived() {
		return dateReceived;
	}

	public void setDateReceived(String dateReceived) {
		this.dateReceived = dateReceived;
	}

	public String getReferenceNumber() {
		return referenceNumber;
	}

	public void setReferenceNumber(String referenceNumber) {
		this.referenceNumber = referenceNumber;
	}

	public String getSeverity() {
		return severity;
	}

	public void setSeverity(String severity) {
		this.severity = severity;
	}

	public String getToken() {
		return token;
	}

	public void setToken(String token) {
		this.token = token;
	}

}

